import React from 'react';

const Button = (props) => {
    let className = 'btn';
    if (props.types) className += 'btn--' + props.types.join(' btn--');
    return (
        <button className={className} onClick={props.onClick}>
            {props.children}
        </button>
    );
};

export default Button;
